	this.initialize = function ()
{
	this.tracePrint ('this.proxy.colorTableLabels.length=' + this.proxy.colorTableLabels.length);
	this.tracePrint ('this.proxy.colorTableColors.length=' + this.proxy.colorTableColors.length);
	// check sizes
	if (this.proxy.colorTableLabels.length != this.proxy.colorTableColors.length)
	{
		this.alwaysPrint ('*** error, mismatched array lengths for this.proxy.colorTableLabels and this.proxy.colorTableColors');
	}
	this.tracePrint ('this.proxy.gridCodes.length=' + this.proxy.gridCodes.length);
	// check legal values for this.proxy.gridCodes indices
	for (i=0; i < this.proxy.gridCodes.length; i++)
	{
		if ((this.proxy.gridCodes[i] < 0) || (this.proxy.gridCodes[i] >= this.proxy.colorTableColors.length))
		{
			this.alwaysPrint ('*** error, this.proxy.gridCodes[' + i + ']=' + this.proxy.gridCodes[i] +
				' is outside allowed range [0..' + (this.proxy.colorTableColors.length - 1) + ']');
		}
	}
	// compute
	for (i=0; i < this.proxy.gridCodes.length; i++)
	{
		index = this.proxy.gridCodes.length - 1 - i;
	//	this.tracePrint ('i=' + i + ', 'index=' + index + ', this.proxy.gridCodes[i]=' + this.proxy.gridCodes[i]);
	//	this.tracePrint ('color=' + this.proxy.colorTableColors[this.proxy.gridCodes[i]]);
		this.proxy.colorArray[i] = this.proxy.colorTableColors[this.proxy.gridCodes[index]];
	//	this.tracePrint ('this.proxy.colorArray.length=' + this.proxy.colorArray.length);
		if (this.proxy.gridCodes[index] == 7)
			this.proxy.heightArray[i] =   0.0;
		else	this.proxy.heightArray[i] = -20.0;
	//	this.tracePrint ('this.proxy.heightArray.length=' + this.proxy.heightArray.length);
	}
	this.tracePrint ('this.proxy.colorArray.length=' + this.proxy.colorArray.length);
	X3DJSON.nodeUtil("Scene","AutogeneratedColorNode", "color",  this.proxy.colorArray);
	this.tracePrint ('this.proxy.heightArray.length=' + this.proxy.heightArray.length);
	this.proxy.newHeight = this.proxy.heightArray;
	this.tracePrint ('initialization() complete');
};

	this.alwaysPrint = function (text)
{
	console.error ('[BuoyCommunicationsGrid] ' + text);
};

	this.tracePrint = function (text)
{
	if (this.proxy.traceEnabled) console.error ('[ColorCodedMinefield] ' + text);
}

